@jit
def dV_dh(vev: jnp.ndarray, lambda_h: jnp.ndarray, h: jnp.ndarray) -> jnp.ndarray:
    mu = vev * jnp.sqrt(lambda_h)
    dV_dh = -mu ** 2 * (vev + h) + lambda_h * (vev + h) ** 3
    return dV_dh

