@jit
def gg_coupling(g, field_value, g_neighbors_gg):

    def _wrapper(field_v_n, g_n):
        g_eff = 0.5 * (g + g_n)
        j_pair = g_eff * (field_value * field_v_n - field_v_n * field_value)
        return j_pair
    vmapped_res = vmap(_wrapper, in_axes=(0, 0, 0, None, None))(*g_neighbors_gg)
    return vmapped_res

