            return j_nu
        j_nu = lax.cond(gluon_index and qindex, lambda : _j_nu_gluon_quark(psi, psi_bar, gamma[index], o_operator, g, qindex), lambda : _j_nu_non_qg(psi, psi_bar, gamma[index], o_operator, g))
